import Lottie from "lottie-react";
import Bubble from "../_animation/Bubble.json";
import React, { Component } from "react";
import "../Style.css";


var BigBubble = () => {
    this.setSpeed=1;
    return <Lottie animationData={Bubble} />;
  };
export default BigBubble;
